import './App.css';
import { AddTodo } from './app/AddTodo';
import { Counter } from './features/counter/Counter';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <Counter />
      <AddTodo />
      <Footer />
    </div>
  );
}

export default App;
